import React from "react";
import { ServicesStyled } from "./ServicesStyle";


function ServicesList() {
    return (
    
    <>
    <ServicesStyled>
      
    
        <li>      
            Automation Scripts
            Report Automation
            Attendee Tracking
        </li>
      
    </ServicesStyled>  
    </>
  )
  }
  export default ServicesList;
